export namespace Enum {
  export const enum ButtonIcon {
    STAR = 'button-star-icon',
  }

  export const enum ButtonColor {
    DEFAULT = 'button-color-default',
    PRIMARY = 'button-color-primary',
    SECONDARY = 'button-color-secondary',
  }

  export const enum ButtonShape {
    SQUARED = 'button-shape-squared',
    ROUNDED = 'button-shape-rounded',
    PILLED = 'button-shape-pilled',
  }

  export const enum ButtonSize {
    SMALL = 'button-size-small',
    MEDIUM = 'button-size-medium',
    LARGE = 'button-size-large',
  }

  export enum ButtonStyle {
    SOLID = 'button-style-solid',
    DOTTED = 'button-style-dotted',
  }

  export const enum ButtonEffect {
    HOVER = 'hover-effect',
    PRESSED = 'pressed-effect',
    DISABLED = 'disabled-effect',
    REST = 'rest-effect',
  }
}
